import { Link } from "react-router-dom";
import { useState } from "react";

const Navbar = () => {

  const [user, setUser] = useState({});

  useEffect(() => {
    axios
      .get("/api/me")
      .then((res) => res.data)
      .then((user) => setUser(user));
  }, []);
  return (
    <nav className="navbar has-background-black-ter mb-4">
      <Link to='/'>
      <h3 className="navbar-item has-text-white">TMDB</h3>
      </Link>
      <div className="navbar-item navbar-end">
        <Link to='/movies'>
        <button className="button is-ghost has-text-white">Peliculas</button>
        </Link>
        <Link to='/tv'>
        <button className="button is-ghost has-text-white">Series</button>
        </Link>
        <Link to='/search'>
        <button className="button is-ghost has-text-white">Buscar</button>
        </Link>
      </div>
      <div className="navbar-item navbar-end">
        {user.id ?(<p className="has-text-white">{user.display_name}</p>):
        ( <div>
        <Link to='/newuser'>
        <strong className="button is-primary">Registrarte</strong>
        </Link>
     <Link to='/logging'>
        <strong className="button is-primary">Iniciar sesion</strong>
     </Link>
     </div>) }

      </div>
    </nav>
  );
};

export default Navbar;
